var intersection = function (nums1, nums2) {
  if (!nums1.length || !nums2.length) return -1;

  const arrSet = new Set(nums1);
  const arrSet2 = new Set([]);

  for (let item of nums2) {
    if (arrSet.has(item)) {
      arrSet2.add(item);
    }
  }
  return [...arrSet2];
};
